import './App.css';
import React, { useState } from 'react';

function App() {
    const [view_tick,set_tick] = useState(0);
    return (
        <div className="App">
            <header id="header">
                <a href="#">Home</a>
                <a href="#">Policy</a>
                <a href="#">Content</a>
            </header>
            <div id="main">
                {view_tick}
                {tick(set_tick)}
            </div>
            <footer id="footer">Footer</footer>
        </div>
    );
}

function tick(set_tick) {
    while (true){
        set_tick(Date())
    }
}

export default App;
